// import { UsersAction } from "../actions/usersAction";
import { UsersState } from "../../types/usersTypes";


export const usersState = [];
export const usersReducer=(state = usersState, action: UsersAction): UsersState => {
    switch (action.type) {
        case "GET_ALL_USERS":
            return [
                 ...action.users
            ];
        case "SORT_ALL_USER": {
            return [
                ...action.users
            ]
        }
        default:
            return state
        }   
}
